import React, { Component } from 'react';
import SearchMovies from './SearchMovies.js';

class App extends Component {
  render() {
    return (
    <div className="container">
      <h1 className="title">React Search Movie</h1>
      <SearchMovies />
    </div>
    );
  }
}

export default App;
